function makeCloseButton(){
  var newElement = document.createElementNS("http://www.w3.org/2000/svg", 'rect');
  newElement.setAttribute("width","65");
  newElement.setAttribute("height","65");
  newElement.setAttribute("x",window.svg.getElementsByTagName('rect')[0].getAttribute("x"));
  newElement.setAttribute("y",window.svg.getElementsByTagName('rect')[0].getAttribute("y"));
  newElement.style.fill = "#f00";
  newElement.style.opacity = "0";
  newElement.addEventListener("click", resetAllPopups, false); 
  window.svg.appendChild(newElement);
  makeLink();
}
function makeLink(){
  var newElement = document.createElementNS("http://www.w3.org/2000/svg", 'rect');
  newElement.setAttribute("width",window.svg.getElementsByTagName('rect')[0].getAttribute("width"));
  newElement.setAttribute("height","80");
  newElement.setAttribute("x",window.svg.getElementsByTagName('rect')[0].getAttribute("x"));
  newElement.setAttribute("y",Number(window.svg.getElementsByTagName('rect')[0].getAttribute("height")) + Number(window.svg.getElementsByTagName('rect')[0].getAttribute("y")) - 80);
  newElement.style.fill = "#f00";
  newElement.style.opacity = "0";
  newElement.addEventListener("click", openLink, false); 
  window.svg.appendChild(newElement);
}
